    playbackData.comments = {"97740903-bf74-40c0-85e9-9269a6eae817":[{"id":"dbb8fa9d-1c1b-4d56-8bce-81ac417a231e","displayCommentEventId":"97740903-bf74-40c0-85e9-9269a6eae817","displayCommentEventSequenceNumber":0,"developerGroupId":"7887d022-9cf3-443f-978c-aca18f6e2571","timestamp":1749141740539,"commentText":"Let's start with the [canonical example program for any language](http://helloworldcollection.de/), here written in Haskell.","textFormat":"markdown","commentTitle":"Our goal","ttsFilePath":null,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"","viewableBlogText":"","commentTags":[],"questionCommentData":null,"position":0}],"5471b2b7-fb7e-4fbd-bb25-97b33c4402a0":[{"id":"4df868c8-b652-4e2d-a60e-a14529d10721","displayCommentEventId":"5471b2b7-fb7e-4fbd-bb25-97b33c4402a0","displayCommentEventSequenceNumber":22,"developerGroupId":"dafe8072-f6b6-40d2-8814-7f5523975baa","timestamp":1749142164225,"commentText":"Here is a program we could write in many imperative programming languages - but not in a functional programming language like Haskell. \n\nIf we try to run this program, here's what we see:\n\n```\n    Parse error: \n    module header, import declaration\n    or top-level declaration expected.\n```","textFormat":"markdown","commentTitle":"Starting out","ttsFilePath":null,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"","commentTags":[],"questionCommentData":null,"position":0}],"b71dadd6-2440-4496-b452-1d57b9e4bc72":[{"id":"5b18bd99-7e52-423e-9b4e-a21fd7c1f16c","displayCommentEventId":"b71dadd6-2440-4496-b452-1d57b9e4bc72","displayCommentEventSequenceNumber":29,"developerGroupId":"dafe8072-f6b6-40d2-8814-7f5523975baa","timestamp":1749142528201,"commentText":"As the error message suggests, we will add a *top-level declaration* - that is, a global declaration that is not nested inside of any other declarations. Here we declare a *variable* named `main`. Similar to the function name `main` in many other programming languages, in Haskell `main` is the standard name we will use for the expression to be evaluated when we run the program.\n\nNow when we run our program we will see the expected output,\n\n```\n\"Hello, world!\"\n```","textFormat":"markdown","commentTitle":"Declarations","ttsFilePath":null,"selectedCodeBlocks":[{"fileId":"720933d0-0776-448e-9921-9791acd95f0d","selectedText":"main = ","selectedTextEventIds":["ff6c54da-9f4d-487d-baf5-d9d4dee7dc56","dc102c28-f27e-4b71-a843-2933d1aa5c32","b5b11228-97dc-41d1-8ece-3d090b206921","6a3aa7ea-d034-44b5-8975-e992b01128a9","497db867-0a9b-421e-9ae9-48be15a02590","edaf17c6-bb51-4309-ad29-40f6fd7e8a4a","b71dadd6-2440-4496-b452-1d57b9e4bc72"],"startRow":0,"startColumn":0,"endRow":0,"endColumn":7},{"fileId":"720933d0-0776-448e-9921-9791acd95f0d","selectedText":"!\"","selectedTextEventIds":["5471b2b7-fb7e-4fbd-bb25-97b33c4402a0","ecde5ff0-e381-4f57-be09-a5fc07e0d58b"],"startRow":0,"startColumn":26,"endRow":0,"endColumn":28}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"main = print \"Hello, world!\"","commentTags":[],"questionCommentData":null,"position":0}],"b6322fc6-5e6d-4002-b459-b140de34a460":[{"id":"f68d7a2e-f392-4f6c-8486-704daf91ccf8","displayCommentEventId":"b6322fc6-5e6d-4002-b459-b140de34a460","displayCommentEventSequenceNumber":66,"developerGroupId":"dafe8072-f6b6-40d2-8814-7f5523975baa","timestamp":1749143047894,"commentText":"Suppose we want to print another message, like \"Hello, Haskell!\" We know how to print \"Hello, world!\", so let's try doing the same thing again. \n\nWhen we try to run our code, we see an error message like the following:\n\n```\n    Multiple declarations of ‘main’\n    Declared at: ./main.hs:1:1\n                 ./main.hs:2:1\n```\n\nAs Joachim Breitner writes, [\"In Haskell, variables are not mutable boxes; they are just names for values!\"](https://haskell-via-sokoban.nomeata.de/#:~:text=variables%20are%20not%20mutable) \n\nThere is no variable assignment in Haskell; there are only declarations. \nEach declaration binds a name to a value. \nThe *binding* is *immutable*: \nonce created, it cannot be changed.\n\nSo, how can we print two things in the same program?","textFormat":"markdown","commentTitle":"Multiple declarations of `main`","ttsFilePath":null,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"","commentTags":[],"questionCommentData":null,"position":0}],"36c3bf6a-a060-49da-b70e-6257eb831f4f":[{"id":"02153432-0a92-401a-b4e9-e643a120e119","displayCommentEventId":"36c3bf6a-a060-49da-b70e-6257eb831f4f","displayCommentEventSequenceNumber":94,"developerGroupId":"dafe8072-f6b6-40d2-8814-7f5523975baa","timestamp":1749143382218,"commentText":"In Haskell, the `do` notation allows us to evaluate multiple expressions in sequence. Here, `do` lets us first print \"Hello, world!\" and then print \"Hello, Haskell!\" \n\nWhy do we need this `do` notation? \nAs we'll soon explore, sequencing is not an essential part of a Haskell program. \nYou can write declarations in any order you want, and the Haskell compiler will figure out for you in what order they should be evaluated. The keyword `do` indicates an exception to this rule, when we want to evaluate a sequence of expressions in a given order. We use `do` with expressions that have *side effects* and break the pure functional paradigm, for example, by printing a value to the screen. \n\nWhen we run this program, the output is as follows:\n\n```\n\"Hello, world!\"\n\"Hello, Haskell!\"\n```","textFormat":"markdown","commentTitle":"Side effects and sequencing","ttsFilePath":null,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"","commentTags":[],"questionCommentData":null,"position":0}],"85bef1b7-00ac-4a1a-9b70-373a61f41247":[{"id":"bb8cfb58-654f-423d-a31f-d929dd773750","displayCommentEventId":"85bef1b7-00ac-4a1a-9b70-373a61f41247","displayCommentEventSequenceNumber":120,"developerGroupId":"dafe8072-f6b6-40d2-8814-7f5523975baa","timestamp":1749143511232,"commentText":"When we display a string on the screen, we don't usually want to see the quotation marks around it. As we'll see later, ``print`` can print any Haskell value to the screen by first converting it to a string. To display a string without quotation marks, we can use a different function, ``putStrLn``.\n\nThe final output of our first program is\n``` \nHello, world!\nHello, Haskell!\n```","textFormat":"markdown","commentTitle":"putStrLn vs print","ttsFilePath":null,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.hs","viewableBlogText":"","commentTags":[],"questionCommentData":null,"position":0}]};
